import pandas as pd

splits = {'train': 'data/train-00000-of-00001-1028f23e353fbe3e.parquet', 'validation': 'data/validation-00000-of-00001-6c7328ff6c84284c.parquet', 'test': 'data/test-00000-of-00001-f0e719df791966ff.parquet'}
train_df = pd.read_parquet("hf://datasets/derek-thomas/ScienceQA/" + splits["train"])

inverted_index = {}
for idx, text in enumerate(train_df['question']):
    for tok in set(text.lower().split()):
        inverted_index.setdefault(tok, []).append(idx)
# Example: lookup "photosynthesis"
print("Examples for 'photosynthesis':", inverted_index.get('photosynthesis', [])[:10])

import pyterrier as pt

if not pt.started():
  pt.init()

